            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "rXV7Q-pm73M",
              "textDisplay": "I&#39;m replying to myself because I described a musical concept. Here&#39;s another. When I saw McCoy Tyner on his Atlantis tour, talking with him between sets, he had two horn players. For one song one horn player had a smaller sax, not an alto, and the other player had a bigger sax, not a baritone. The low sax player would start a big bubbling riff and take it up the scale until the higher sax blended in and took it up higher. The bass would start again before the high sax stopped and it created a circular motion of sound, a very special acoustic effect. The bass player, Juni Booth, was using a Fender Jazz bass, an electric, because his upright was stolen at the New York airport.It&#39;still my favorite solo piano, McCoy Tyner, &quot;Naima&quot;, off &quot;Echoes of a Friend&quot;. If you listen here make sure it&#39;s the studio version, even if it only shows the album cover.",
              "textOriginal": "I'm replying to myself because I described a musical concept. Here's another. When I saw McCoy Tyner on his Atlantis tour, talking with him between sets, he had two horn players. For one song one horn player had a smaller sax, not an alto, and the other player had a bigger sax, not a baritone. The low sax player would start a big bubbling riff and take it up the scale until the higher sax blended in and took it up higher. The bass would start again before the high sax stopped and it created a circular motion of sound, a very special acoustic effect. The bass player, Juni Booth, was using a Fender Jazz bass, an electric, because his upright was stolen at the New York airport.It'still my favorite solo piano, McCoy Tyner, \"Naima\", off \"Echoes of a Friend\". If you listen here make sure it's the studio version, even if it only shows the album cover.",
