    {
      "kind": "youtube#commentThread",
      "etag": "7uHGF1sMKRQiHCPAtDHgaY5_WGQ",
      "id": "UgxSIHtSDc4I56_F-6p4AaABAg",
      "replies": {
        "comments": [
          {
            "kind": "youtube#comment",
            "etag": "nAyiIGcyPkedJfDuvqq7PzjoOOM",
            "id": "UgxSIHtSDc4I56_F-6p4AaABAg.9Ny0TFMAOnF9Ny253PcGP3",
            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "3kRl7gkXdXM",
              "textDisplay": "Last Part 7 of 7\u003cbr\u003e\u003cbr\u003eBTS is a true phenomenon of our generation. It’s really a story from ”nobodies” to legends. Each of the things they’ve achieved and accomplished are well deserved and hard earned. They deserve their support, without those bitter, jealous, ignorant haters who’re downgrading their music, quality, talent, artistery and versatility. Haters will hate no matter what. The bigger success the more haters come alongbut most importantly more Armys.\u003cbr\u003e\u003cbr\u003eLynda Olanoff, creative consultant for horror films in Hollywood like Nightmare Before Christmas, working for Disney/Pixar, Warner bros etc. She tweeted: ”They are all very kind and humble, every last one of them. Had a chance to meet them at the Rose Bowl (LA) show back in May (2019). The love they have for eachother is amazing. I’ve seen groups come and go for over 40 years now and let me tell you, BTS is here to stay.” \u003cbr\u003e\u003cbr\u003eTv-show host Jimmy Fallon said 2020: ”In my opinion there’s no other bigger band, in the United states and in the world. There’s no other bigger band than BTS. They can dance, they can sing, they can rap! They always put the time and the effort in. There’s no one like them. \u003cbr\u003eEverytime they came on, they would say something else to me, they’d say, we want to do this next, and they would do it! We wanna get nominated for a Grammy, and they did! It’s amazing. They’re magic. BTS is magic.”\u003cbr\u003e\u003cbr\u003eDue to the pandemic, BTS had to cancel their 2020 ”Map Of the Soul” World Tour. In their annual ”BTS Festa” party for their 7th anniversary, they heartfeltly teared up as they (at \u003ca href=\"https://www.youtube.com/watch?v=3kRl7gkXdXM&amp;t=47m50s\"\u003e47:50\u003c/a\u003e) talked about this: \u003ca href=\"https://youtu.be/t9zPnWQIiuw\"\u003ehttps://youtu.be/t9zPnWQIiuw\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eHowever they’ve kept working non-stop. They’ve released two albums, had tons of wonderful performances with remarkable production works and scenographies, done VLives, interviews etc.\u003cbr\u003eThey performed a free live-streamed concert “Bang Bang Con The Live Concert”. On Weverse they released their latest docu-series: ”Break The Silence”.\u003cbr\u003eFor their performance at Youtube’s ”Dear Class of 2020”, BTS rented ”The National Museum of Korea” (whereas other artists sang in their houses): \u003ca href=\"https://youtu.be/ErTgtL1Tjns\"\u003ehttps://youtu.be/ErTgtL1Tjns\u003c/a\u003e\u003cbr\u003eThey released two Japanese singles  ”Stay Gold” and breathtakingly ballad ”Your Eyes Tell” composed by JK, which once again proved BTS’s amazing vocalists. This was the first Japanese song in history to achieve 92 #1 in the first 24h. One of their live performances in Japan: \u003ca href=\"https://youtu.be/E1uFvKzoNwA\"\u003ehttps://youtu.be/E1uFvKzoNwA\u003c/a\u003e \u003cbr\u003eWhen they had to cancel their World Tour, they wanted to reach out to Army around the world in a difficult time by making a new, brighter album. During the planning of the album, BTS told us that it’d be more ”uplifting” than the previous album. Their solid debute performance of comeback single ”Dynamite” on ”MTV VMAs”, and also won 4 awards: \u003ca href=\"https://youtu.be/zJCdkOpU90g\"\u003ehttps://youtu.be/zJCdkOpU90g\u003c/a\u003e\u003cbr\u003eBTS performed amazingly  for ”America’s Got Talent”: \u003ca href=\"https://youtu.be/MH_vjfNPv70\"\u003ehttps://youtu.be/MH_vjfNPv70\u003c/a\u003e\u003cbr\u003eThe dance practice video: \u003ca href=\"https://youtu.be/CN4fffh7gmk\"\u003ehttps://youtu.be/CN4fffh7gmk\u003c/a\u003e\u003cbr\u003eTheir great ”Tiny Desk Home Concert”: \u003ca href=\"https://youtu.be/gFYAXsa7pe8\"\u003ehttps://youtu.be/gFYAXsa7pe8\u003c/a\u003e  \u003cbr\u003eTheir performances at Lotte Duty Free Family concert: \u003ca href=\"https://youtu.be/T29a0mnFka0\"\u003ehttps://youtu.be/T29a0mnFka0\u003c/a\u003e\u003cbr\u003eTheir performances at ”The Tonight Show with Jimmy Fallon” (recorded in the ”Gyeongbok Palace”; the main royal palace of the Joseon dynasty built in 1395, Seoul), were absolutely stunning. For ”Idol” they wore modern versions of national costumes Hanbok: \u003ca href=\"https://youtu.be/MXFkjMNXfpY\"\u003ehttps://youtu.be/MXFkjMNXfpY\u003c/a\u003e \u003cbr\u003e”Mikrokosmos” was recorded in the ”Gyeonghoeru Pavilion” located on a beautiful pond inside the palace. Fyi, the stars in the sky aren’t CGI but drones: \u003ca href=\"https://youtu.be/oYpUZjxJOVg\"\u003ehttps://youtu.be/oYpUZjxJOVg\u003c/a\u003e\u003cbr\u003eAt the show they also had a majestically, ethereally ”Black Swan” performance: \u003ca href=\"https://youtu.be/g1-sFn-j5D0\"\u003ehttps://youtu.be/g1-sFn-j5D0\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eDue to the cancellation of their world tour, they held an amazing online concert ”Map of the soul On:e”. \u003cbr\u003eThey also released the wonderful 8-episode reality series, ”BTS In The Soop” on the Weverse-app. The word ”soop” means forest in Korean and the show followed BTS as they spent time doing fun things together outdoors.\u003cbr\u003eIn Nov. 2020, BTS released a new album ”BE”; their 5th no.1 album on ”Billboard 200”. The MV for title track ”Life Goes On” was directed by Jungkook.\u003cbr\u003e For the AMA 2020 in which they won two awards (”Favorite Duo or Group - Pop/Rock” and ”Favorite Social Artist”), they pre-recorded their performance at the ”Seoul Olympic Stadium”; a place that reminds them of Army.\u003cbr\u003eTheir wonderful Christmas themed performance of ”Dynamite” and ”Life goes on” at ”The Late Late Show With James Gordon” exceeds everyone else’s we’ve seen: \u003ca href=\"https://youtu.be/aMIGbLUJug4\"\u003ehttps://youtu.be/aMIGbLUJug4\u003c/a\u003e\u003cbr\u003eBTS Japanese 2021 single ”Film Out” had the most streams in 24h for a Japanese song.\u003cbr\u003eTheir Coldplay cover of ”Fix You” is incredibly beautiful and Coldplay even tweeted ”Beautiful” in Korean, as well as on Youtube. \u003cbr\u003e\u003cbr\u003eBTS was the best-selling artist 2020. \u003cbr\u003eIn 2021, they got their own McDonalds BTS Meal. \u003cbr\u003e\u003cbr\u003eNo other boyband in the past, or any artist today can match the brilliance of BTS. They’re the biggest, a national treasure; biggest in modern time (far bigger than any Olympic athlete, classical musician etc). BTS will go down in history. There won’t be a group like BTS in the future.\u003cbr\u003e\u003cbr\u003eBtw, I’m not an English speaker and it isn’t my first language. Thanks for reading my tribute ”novel”.\u003cbr\u003e\u003cbr\u003eSome of BTS’s amazing MV’s with incredible choreo:\u003cbr\u003e\u003cbr\u003e2015 Dope: \u003ca href=\"https://youtu.be/H8lYMWZD5P8\"\u003ehttps://youtu.be/H8lYMWZD5P8\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2015 Fire: \u003ca href=\"https://youtu.be/4ujQOR2DMFM\"\u003ehttps://youtu.be/4ujQOR2DMFM\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2016 Blood Sweat and Tears: \u003ca href=\"https://youtu.be/hmE9f-TEutc\"\u003ehttps://youtu.be/hmE9f-TEutc\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2017 Not Today: \u003ca href=\"https://youtu.be/9DwzBICPhdM\"\u003ehttps://youtu.be/9DwzBICPhdM\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e2018 Airplane Pt.2 (Follow-up of J-Hope’s solo song ”Airplane”)(This is the Japanese version) \u003ca href=\"https://youtu.be/CxnJf0tWu48\"\u003ehttps://youtu.be/CxnJf0tWu48\u003c/a\u003e",
              "textOriginal": "Last Part 7 of 7\n\nBTS is a true phenomenon of our generation. It’s really a story from ”nobodies” to legends. Each of the things they’ve achieved and accomplished are well deserved and hard earned. They deserve their support, without those bitter, jealous, ignorant haters who’re downgrading their music, quality, talent, artistery and versatility. Haters will hate no matter what. The bigger success the more haters come alongbut most importantly more Armys.\n\nLynda Olanoff, creative consultant for horror films in Hollywood like Nightmare Before Christmas, working for Disney/Pixar, Warner bros etc. She tweeted: ”They are all very kind and humble, every last one of them. Had a chance to meet them at the Rose Bowl (LA) show back in May (2019). The love they have for eachother is amazing. I’ve seen groups come and go for over 40 years now and let me tell you, BTS is here to stay.” \n\nTv-show host Jimmy Fallon said 2020: ”In my opinion there’s no other bigger band, in the United states and in the world. There’s no other bigger band than BTS. They can dance, they can sing, they can rap! They always put the time and the effort in. There’s no one like them. \nEverytime they came on, they would say something else to me, they’d say, we want to do this next, and they would do it! We wanna get nominated for a Grammy, and they did! It’s amazing. They’re magic. BTS is magic.”\n\nDue to the pandemic, BTS had to cancel their 2020 ”Map Of the Soul” World Tour. In their annual ”BTS Festa” party for their 7th anniversary, they heartfeltly teared up as they (at 47:50) talked about this: https://youtu.be/t9zPnWQIiuw\n\nHowever they’ve kept working non-stop. They’ve released two albums, had tons of wonderful performances with remarkable production works and scenographies, done VLives, interviews etc.\nThey performed a free live-streamed concert “Bang Bang Con The Live Concert”. On Weverse they released their latest docu-series: ”Break The Silence”.\nFor their performance at Youtube’s ”Dear Class of 2020”, BTS rented ”The National Museum of Korea” (whereas other artists sang in their houses): https://youtu.be/ErTgtL1Tjns\nThey released two Japanese singles  ”Stay Gold” and breathtakingly ballad ”Your Eyes Tell” composed by JK, which once again proved BTS’s amazing vocalists. This was the first Japanese song in history to achieve 92 #1 in the first 24h. One of their live performances in Japan: https://youtu.be/E1uFvKzoNwA \nWhen they had to cancel their World Tour, they wanted to reach out to Army around the world in a difficult time by making a new, brighter album. During the planning of the album, BTS told us that it’d be more ”uplifting” than the previous album. Their solid debute performance of comeback single ”Dynamite” on ”MTV VMAs”, and also won 4 awards: https://youtu.be/zJCdkOpU90g\nBTS performed amazingly  for ”America’s Got Talent”: https://youtu.be/MH_vjfNPv70\nThe dance practice video: https://youtu.be/CN4fffh7gmk\nTheir great ”Tiny Desk Home Concert”: https://youtu.be/gFYAXsa7pe8  \nTheir performances at Lotte Duty Free Family concert: https://youtu.be/T29a0mnFka0\nTheir performances at ”The Tonight Show with Jimmy Fallon” (recorded in the ”Gyeongbok Palace”; the main royal palace of the Joseon dynasty built in 1395, Seoul), were absolutely stunning. For ”Idol” they wore modern versions of national costumes Hanbok: https://youtu.be/MXFkjMNXfpY \n”Mikrokosmos” was recorded in the ”Gyeonghoeru Pavilion” located on a beautiful pond inside the palace. Fyi, the stars in the sky aren’t CGI but drones: https://youtu.be/oYpUZjxJOVg\nAt the show they also had a majestically, ethereally ”Black Swan” performance: https://youtu.be/g1-sFn-j5D0\n\nDue to the cancellation of their world tour, they held an amazing online concert ”Map of the soul On:e”. \nThey also released the wonderful 8-episode reality series, ”BTS In The Soop” on the Weverse-app. The word ”soop” means forest in Korean and the show followed BTS as they spent time doing fun things together outdoors.\nIn Nov. 2020, BTS released a new album ”BE”; their 5th no.1 album on ”Billboard 200”. The MV for title track ”Life Goes On” was directed by Jungkook.\n For the AMA 2020 in which they won two awards (”Favorite Duo or Group - Pop/Rock” and ”Favorite Social Artist”), they pre-recorded their performance at the ”Seoul Olympic Stadium”; a place that reminds them of Army.\nTheir wonderful Christmas themed performance of ”Dynamite” and ”Life goes on” at ”The Late Late Show With James Gordon” exceeds everyone else’s we’ve seen: https://youtu.be/aMIGbLUJug4\nBTS Japanese 2021 single ”Film Out” had the most streams in 24h for a Japanese song.\nTheir Coldplay cover of ”Fix You” is incredibly beautiful and Coldplay even tweeted ”Beautiful” in Korean, as well as on Youtube. \n\nBTS was the best-selling artist 2020. \nIn 2021, they got their own McDonalds BTS Meal. \n\nNo other boyband in the past, or any artist today can match the brilliance of BTS. They’re the biggest, a national treasure; biggest in modern time (far bigger than any Olympic athlete, classical musician etc). BTS will go down in history. There won’t be a group like BTS in the future.\n\nBtw, I’m not an English speaker and it isn’t my first language. Thanks for reading my tribute ”novel”.\n\nSome of BTS’s amazing MV’s with incredible choreo:\n\n2015 Dope: https://youtu.be/H8lYMWZD5P8\n\n2015 Fire: https://youtu.be/4ujQOR2DMFM\n\n2016 Blood Sweat and Tears: https://youtu.be/hmE9f-TEutc\n\n2017 Not Today: https://youtu.be/9DwzBICPhdM\n\n2018 Airplane Pt.2 (Follow-up of J-Hope’s solo song ”Airplane”)(This is the Japanese version) https://youtu.be/CxnJf0tWu48",
