              "textDisplay": "Part 6 of 7: \u003cbr\u003e\u003cbr\u003eTheir hilarious video-sketch ”House of Army” at the 3rd Muster 2016 is a must-watch, and also shows their well-known amazing acting skills: \u003ca href=\"https://youtu.be/BwBCj_XWgZ8\"\u003ehttps://youtu.be/BwBCj_XWgZ8\u003c/a\u003e\u003cbr\u003eThe Muster concert was first only in S.Koreabut they expanded a Muster for Japan too. At the 5th Japanese Muster they had an awesome, rare performance of ”Pied Piper”: \u003ca href=\"https://youtu.be/mELw4UrHxKU\"\u003ehttps://youtu.be/mELw4UrHxKU\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eFor Chuseok (Korean Thanksgiving) they’ve dressed up in Hanbok (national traditional costume), and for Halloween they’ve dressed up in funny costumes and in 2017 they were Snowhite &amp; the 7 dwarfs in their hilarious ”GoGo” dance practice video: \u003ca href=\"https://youtu.be/Fl54gG0B8I0\"\u003ehttps://youtu.be/Fl54gG0B8I0\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eEvery year, BTS releases a photo book and DVD-collection that memorializes the previous year, called ”BTS Memories of (the year)”. This contains footage that’s never before shown to Army. \u003cbr\u003e\u003cbr\u003eAt the end of every year they release a  ”Season Greetings Special”. Meanwhile all this, BTS writes/records music, dance practices, has shootings, prepares for comeback, promotions, fansigns, rehearses for world tours etc. There’s a legit reason why BTS multiple times has won ”Top Social Artist” at BBMA, and ”Favorite Social Artist” at AMA. Unlike predjudice, it’s not ”crazy” Armys voting without reason. BTS deserves their ”Social” wins. They’re also the first Korean and Asian act to perform (”DNA”) at ”AMA” 2017: \u003ca href=\"https://youtu.be/L90luiRAKBI\"\u003ehttps://youtu.be/L90luiRAKBI\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eMoreover there is the ”BTS Net Marble Game: BTS World”.\u003cbr\u003e\u003cbr\u003eBTS is so hard working, dedicated and passionate about what they’re doing. They’ve never shyed away from challenging themselves or trying something new or different. Army have raised concerns about them working too hard non-stop, without enough rest. In 2019 they got their first extended break (5 weeks) in 6 years. BTS has said they work much because they want to share new content with Army who’re eagerly waiting, and want to ”pay back” for always supporting and being by their side. They’ve always loved, cared for and encouraged Army who they don’t want to worry or disappoint. \u003cbr\u003e\u003cbr\u003eThey’ve never taken anything or anyone for granted and are so humble. After walking the red-carpet before their performance at iHR Jingle Ball concert 2019, they were touched by the loud cheers from the fans. JK said ”Wow BTS has come a long way”. Jin said he felt like a superstar. After their performance, RM said: ”I didn’t think alot of our fans would come because of all the huge names in the line-upbut our fans made us feel big”. Jin said: ”As soon as we entered we heard BTS BTS! Wow isn’t that amazing?!”, which everyone agreed to. \u003cbr\u003e\u003cbr\u003eAfter U.S. award shows with the after-partys that they’ve been invited to, they’ve gone someplace else, like one of their hotelrooms to go VLive to speak to Army about their experience. Thereafter they’ve made a toast and celebrated on their own. Even after concerts which end late and they’re tired and sweaty, one or more members go VLive in one’s hotelroom. They’ve always spoken from their hearts and shown their true selves without facades. \u003cbr\u003e\u003cbr\u003eBTS has done alot of charity work. In 2019 Jimin donated 100 million KRW ($89M) to the Busan City Office of Education (his birth city) to be used for education development. \u003cbr\u003eHe donated $26 000 and over 1200 desks and chairs for students at his alma mater ”Busan Highschool of Arts”. Jimin reportedly didn’t want to make this public and performed the good deed quietly during winter break. He also provided the graduating elementary students in Busan with funds to buy their school-uniforms. During the pandemic he donated 100 million KRW ($89M) to the Jeonnam Future Education Foundation. \u003cbr\u003e\u003cbr\u003eWhen Jin joined ”UNICEF Korea’s Honors Club”, members must donate at least 100 million KRW, and Jin secretly started donating regurely after BTS partnered with UNICEF in 2018. For his birthday 2021, Suga donated 100 million KRW to Keimyung University Dongsan Hospital in hometown Daegu, to support child cancer patients.\u003cbr\u003eIn 2020, BTS who’re non-Americans, donated $1M to ”Black Lives Matter”, while rest of the world posted a black square and call it a day. BTS donated over $2M to Yemen, as well as for the ongoing crisis in Lebanon. They donated over $1M to their concert crew who’re unemployed due to the pandemic, and the members also made individual donations. BTS said that their crew are their wings. Moreover, they donated to the flood victims in S.Korea. \u003cbr\u003e\u003cbr\u003ePeople in the music industry have said they’re just really nice guys, who together create the best team. They’ve a genuine love for eachother and being together is what they love the most. BTS have said that although they’ve had disagreement, they’ve never had a big fight. \u003ca href=\"https://youtu.be/EOVDdyStnhI\"\u003ehttps://youtu.be/EOVDdyStnhI\u003c/a\u003e\u003cbr\u003eThe members got own apartmentsbut they still also live in their big house in Seoul. In the past Jimin and J-hope were roommates and have been the longest. RM and V shared a room, Jin and Suga shared a room. Jungkook had mostly his own room which litterally was a walk-in closet in which he also had his clothes. That’s where he made his incredible ”hobby” G.C.F films in his free-time. In 2017, 20 year old he surprised everyone including the members, by releasing his first all self-made film ”G.C.F Tokyo” featuring Jimin from a trip he arranged for Jimin who turned 22 (but who wasn’t aware of Jk filming for anything): \u003ca href=\"https://youtu.be/XrTNLkqGrlc\"\u003ehttps://youtu.be/XrTNLkqGrlc\u003c/a\u003e  Since then he’s released more G.C.F’s which are available on YT. The reason Jk named his studio/film projects ”Golden Closet Film” G.C.F, is because he is called the Golden maknae = Golden youngest and started his work in a closet. \u003cbr\u003e\u003cbr\u003eAt their concerts/performances, Army are lightening up the stadiums with their Official light sticks called Army bombs. They’re also chanting their Official fanchant with their real names, not stage names. Leader RM comes first, then order by age: \u003cbr\u003e”Kim Namjoon  \u003cbr\u003eKim Seokjin \u003cbr\u003eMin Yoongi \u003cbr\u003eJung Hoseok  \u003cbr\u003ePark Jimin \u003cbr\u003eKim Taehyung \u003cbr\u003eJeon Jungkook \u003cbr\u003eBTS!” \u003cbr\u003e\u003cbr\u003eTheir first 2020 album was ”Map of the Soul: 7”. For BTS, 7 will always be a special number as there’re 7 members, and 2020 it was 7 years since debute in 2013. One song on the album that’s deeply touched Army, is the so wonderful and touching ”We are Bulletproof : The Eternal” with a beautiful animated MV which reflects their past hardships and MV’s : \u003ca href=\"https://youtu.be/7UWBYJjuIL0\"\u003ehttps://youtu.be/7UWBYJjuIL0\u003c/a\u003e\u003cbr\u003eOn the album they’re inspired by Swiss psychiatrist and Psychoanalyst Carl Jung who founded analytical psychology. \u003cbr\u003eOpposite to previous ”Boy with luv”,  ”Black Swan” and ”ON” (reboot of their 2013 song N.O) were darker. The album is beautiful and thought-provoking while sending out a message of moving forward in times of trouble, and not caring what others say about you in a negative sense. Suga described: ”U must face your inner shadows but resist becoming submerged into it’s depths”. \u003cbr\u003e \u003cbr\u003eIn S.Korea a guy calls an older brother/guy ”hyung” = big brother. A girl calls an older brother/guy ”oppa”. So for example V says ”Jin-hyung” when speaking to/about him, Younger female fans would say ”Jin-oppa”. A guy calls an older sister/female ”noona” = big sister, whereas a girl calls an older sister/female ”unnie”. BTS is sometimes divided into the ”hyung line” (Jin, Suga, J-Hope, RM), and the ”maknae line” (Jimin, V, Jungkook). \u003cbr\u003eA younger sibling/male/female is called ”dongsaeng”. So for RM, the maknae line would be his dongsaengs.\u003cbr\u003e\u003cbr\u003eIn 2017 the 1st album in their ”Love Yourself”-trilogy was released. This huge epic era was about self-love and learn to accept who u are. This was followed by ”Speak Yourself” were u shouldn’t only love yourself but also speak yourself. Then came ”Map of the Soul: Persona” and ”Map of the Soul:7”, including the solo songs of the rap line and Jimin’s record-breaking ”Filter” which topped the world&#39;s major music charts, so far #1 on iTunes in 111 countries. \u003cbr\u003eLet’s not forget BTS’s amazing previous work such as the iconic ”Wings”-era. \u003cbr\u003e\u003cbr\u003eTheir world tours (”Love Yourself” 2018 and ”Speak Yourself” 2019) were amazing. They’re remarkable performers/entertainers. In S.Korea they’re stars and ”household” names and mostly they can’t go out without security. At airports it’s usually fussy with fans and media frenzy. They all started out very young. Today Jungkook is 23, V and Jimin 25. RM and J-Hope 26, Suga 27, Jin 28.\u003cbr\u003e\u003cbr\u003eFyi. Koreans have a different age system and count age differently. \u003cbr\u003eWhen a Korean baby is born (and throughout that birthyear), it’s 1 year old, and every New Year it gets one year older. So a baby who’s born on December 31, 2019, got 2 years old on January 1, 2020. \u003cbr\u003eFor non-Korean Army it can be confusing, because when BTS is talking about themselves/celebrating their b-days, they’re always 1 or 2 years older. By international age, oldest member Jin turned 28 in Dec 2020. However, in Korean age he turned 29, and on January 1, 2021 he got 30! \u003cbr\u003e\u003cbr\u003eThe colour of BTS is purple and that’s why they came up with ”I purple you” = ”Borahae” = ”I love you”. They also make the iconic fingerhearts, a love sign to Army💜. Multiple cities around the world have on different occasions lighted up iconic monuments/buildings in purple (like Empire State Building in NY City, Gwangan Bridge in Busan, and London) to honor BTS when they’re having concerts, visits or celebrate them in some way. S.Korean buses and subways have been painted in purple. For Jimin’s 24th b-day some Seoul subway lines were customized with Jimin-themes. Even the huge screens on Times Square has many times featured BTS, as well as of the members for their b-days.\u003cbr\u003e\u003cbr\u003eFinish last part 7 of 7 in the replies",
              "textOriginal": "Part 6 of 7: \n\nTheir hilarious video-sketch ”House of Army” at the 3rd Muster 2016 is a must-watch, and also shows their well-known amazing acting skills: https://youtu.be/BwBCj_XWgZ8\nThe Muster concert was first only in S.Koreabut they expanded a Muster for Japan too. At the 5th Japanese Muster they had an awesome, rare performance of ”Pied Piper”: https://youtu.be/mELw4UrHxKU\n\nFor Chuseok (Korean Thanksgiving) they’ve dressed up in Hanbok (national traditional costume), and for Halloween they’ve dressed up in funny costumes and in 2017 they were Snowhite & the 7 dwarfs in their hilarious ”GoGo” dance practice video: https://youtu.be/Fl54gG0B8I0\n\nEvery year, BTS releases a photo book and DVD-collection that memorializes the previous year, called ”BTS Memories of (the year)”. This contains footage that’s never before shown to Army. \n\nAt the end of every year they release a  ”Season Greetings Special”. Meanwhile all this, BTS writes/records music, dance practices, has shootings, prepares for comeback, promotions, fansigns, rehearses for world tours etc. There’s a legit reason why BTS multiple times has won ”Top Social Artist” at BBMA, and ”Favorite Social Artist” at AMA. Unlike predjudice, it’s not ”crazy” Armys voting without reason. BTS deserves their ”Social” wins. They’re also the first Korean and Asian act to perform (”DNA”) at ”AMA” 2017: https://youtu.be/L90luiRAKBI\n\nMoreover there is the ”BTS Net Marble Game: BTS World”.\n\nBTS is so hard working, dedicated and passionate about what they’re doing. They’ve never shyed away from challenging themselves or trying something new or different. Army have raised concerns about them working too hard non-stop, without enough rest. In 2019 they got their first extended break (5 weeks) in 6 years. BTS has said they work much because they want to share new content with Army who’re eagerly waiting, and want to ”pay back” for always supporting and being by their side. They’ve always loved, cared for and encouraged Army who they don’t want to worry or disappoint. \n\nThey’ve never taken anything or anyone for granted and are so humble. After walking the red-carpet before their performance at iHR Jingle Ball concert 2019, they were touched by the loud cheers from the fans. JK said ”Wow BTS has come a long way”. Jin said he felt like a superstar. After their performance, RM said: ”I didn’t think alot of our fans would come because of all the huge names in the line-upbut our fans made us feel big”. Jin said: ”As soon as we entered we heard BTS BTS! Wow isn’t that amazing?!”, which everyone agreed to. \n\nAfter U.S. award shows with the after-partys that they’ve been invited to, they’ve gone someplace else, like one of their hotelrooms to go VLive to speak to Army about their experience. Thereafter they’ve made a toast and celebrated on their own. Even after concerts which end late and they’re tired and sweaty, one or more members go VLive in one’s hotelroom. They’ve always spoken from their hearts and shown their true selves without facades. \n\nBTS has done alot of charity work. In 2019 Jimin donated 100 million KRW ($89M) to the Busan City Office of Education (his birth city) to be used for education development. \nHe donated $26 000 and over 1200 desks and chairs for students at his alma mater ”Busan Highschool of Arts”. Jimin reportedly didn’t want to make this public and performed the good deed quietly during winter break. He also provided the graduating elementary students in Busan with funds to buy their school-uniforms. During the pandemic he donated 100 million KRW ($89M) to the Jeonnam Future Education Foundation. \n\nWhen Jin joined ”UNICEF Korea’s Honors Club”, members must donate at least 100 million KRW, and Jin secretly started donating regurely after BTS partnered with UNICEF in 2018. For his birthday 2021, Suga donated 100 million KRW to Keimyung University Dongsan Hospital in hometown Daegu, to support child cancer patients.\nIn 2020, BTS who’re non-Americans, donated $1M to ”Black Lives Matter”, while rest of the world posted a black square and call it a day. BTS donated over $2M to Yemen, as well as for the ongoing crisis in Lebanon. They donated over $1M to their concert crew who’re unemployed due to the pandemic, and the members also made individual donations. BTS said that their crew are their wings. Moreover, they donated to the flood victims in S.Korea. \n\nPeople in the music industry have said they’re just really nice guys, who together create the best team. They’ve a genuine love for eachother and being together is what they love the most. BTS have said that although they’ve had disagreement, they’ve never had a big fight. https://youtu.be/EOVDdyStnhI\nThe members got own apartmentsbut they still also live in their big house in Seoul. In the past Jimin and J-hope were roommates and have been the longest. RM and V shared a room, Jin and Suga shared a room. Jungkook had mostly his own room which litterally was a walk-in closet in which he also had his clothes. That’s where he made his incredible ”hobby” G.C.F films in his free-time. In 2017, 20 year old he surprised everyone including the members, by releasing his first all self-made film ”G.C.F Tokyo” featuring Jimin from a trip he arranged for Jimin who turned 22 (but who wasn’t aware of Jk filming for anything): https://youtu.be/XrTNLkqGrlc  Since then he’s released more G.C.F’s which are available on YT. The reason Jk named his studio/film projects ”Golden Closet Film” G.C.F, is because he is called the Golden maknae = Golden youngest and started his work in a closet. \n\nAt their concerts/performances, Army are lightening up the stadiums with their Official light sticks called Army bombs. They’re also chanting their Official fanchant with their real names, not stage names. Leader RM comes first, then order by age: \n”Kim Namjoon  \nKim Seokjin \nMin Yoongi \nJung Hoseok  \nPark Jimin \nKim Taehyung \nJeon Jungkook \nBTS!” \n\nTheir first 2020 album was ”Map of the Soul: 7”. For BTS, 7 will always be a special number as there’re 7 members, and 2020 it was 7 years since debute in 2013. One song on the album that’s deeply touched Army, is the so wonderful and touching ”We are Bulletproof : The Eternal” with a beautiful animated MV which reflects their past hardships and MV’s : https://youtu.be/7UWBYJjuIL0\nOn the album they’re inspired by Swiss psychiatrist and Psychoanalyst Carl Jung who founded analytical psychology. \nOpposite to previous ”Boy with luv”,  ”Black Swan” and ”ON” (reboot of their 2013 song N.O) were darker. The album is beautiful and thought-provoking while sending out a message of moving forward in times of trouble, and not caring what others say about you in a negative sense. Suga described: ”U must face your inner shadows but resist becoming submerged into it’s depths”. \n \nIn S.Korea a guy calls an older brother/guy ”hyung” = big brother. A girl calls an older brother/guy ”oppa”. So for example V says ”Jin-hyung” when speaking to/about him, Younger female fans would say ”Jin-oppa”. A guy calls an older sister/female ”noona” = big sister, whereas a girl calls an older sister/female ”unnie”. BTS is sometimes divided into the ”hyung line” (Jin, Suga, J-Hope, RM), and the ”maknae line” (Jimin, V, Jungkook). \nA younger sibling/male/female is called ”dongsaeng”. So for RM, the maknae line would be his dongsaengs.\n\nIn 2017 the 1st album in their ”Love Yourself”-trilogy was released. This huge epic era was about self-love and learn to accept who u are. This was followed by ”Speak Yourself” were u shouldn’t only love yourself but also speak yourself. Then came ”Map of the Soul: Persona” and ”Map of the Soul:7”, including the solo songs of the rap line and Jimin’s record-breaking ”Filter” which topped the world's major music charts, so far #1 on iTunes in 111 countries. \nLet’s not forget BTS’s amazing previous work such as the iconic ”Wings”-era. \n\nTheir world tours (”Love Yourself” 2018 and ”Speak Yourself” 2019) were amazing. They’re remarkable performers/entertainers. In S.Korea they’re stars and ”household” names and mostly they can’t go out without security. At airports it’s usually fussy with fans and media frenzy. They all started out very young. Today Jungkook is 23, V and Jimin 25. RM and J-Hope 26, Suga 27, Jin 28.\n\nFyi. Koreans have a different age system and count age differently. \nWhen a Korean baby is born (and throughout that birthyear), it’s 1 year old, and every New Year it gets one year older. So a baby who’s born on December 31, 2019, got 2 years old on January 1, 2020. \nFor non-Korean Army it can be confusing, because when BTS is talking about themselves/celebrating their b-days, they’re always 1 or 2 years older. By international age, oldest member Jin turned 28 in Dec 2020. However, in Korean age he turned 29, and on January 1, 2021 he got 30! \n\nThe colour of BTS is purple and that’s why they came up with ”I purple you” = ”Borahae” = ”I love you”. They also make the iconic fingerhearts, a love sign to Army💜. Multiple cities around the world have on different occasions lighted up iconic monuments/buildings in purple (like Empire State Building in NY City, Gwangan Bridge in Busan, and London) to honor BTS when they’re having concerts, visits or celebrate them in some way. S.Korean buses and subways have been painted in purple. For Jimin’s 24th b-day some Seoul subway lines were customized with Jimin-themes. Even the huge screens on Times Square has many times featured BTS, as well as of the members for their b-days.\n\nFinish last part 7 of 7 in the replies",
