              "textDisplay": "Part 5 of 7:\u003cbr\u003e \u003cbr\u003eOn their studio albums, nor when performing live, BTS has never used back-up singers. So when performing live, a member sometimes complements his live vocals with subtle a backtrack in tough choreo parts. Sadly some antis get backtrack vocals mixed up with lip-syncing which is unfair and totally not the same!\u003cbr\u003e\u003cbr\u003eWestern award shows/TV shows have multiple times muted the Army fanchants, which also sadly have muted/toned down the voices of BTS. Compared to other artists’ performances, these shows have been criticized for focusing more screentime on the audience’s reactions, than BTS on stage.\u003cbr\u003e\u003cbr\u003eJimin is a rare counter tenor which is a male singing voice equivalent to a female contralto or mezzo-soprano. He has the highest pitch voice and can hit very high notes. He’s considered to have one of the most unique voices. Fatima from ”USA Today” tweeted: ”Jimin has one of the most unique &amp; amazing vocals I’ve ever heard in the entire music industry. It can be smooth &amp; sweet but also rough &amp; raspy in the best way, &amp; he exhibits emotions thru it so beautifully”. Jimin has said he can get very nervous on stage. Since he is a perfectionist and hard on himself, there’s been times he’s shed tears (onstage and backstage) when his voice has cracked. Antis have unfairly accused him that he can’t sing. Look at his 18-year old impressive vocals in ”Let me know” 2014, which was written, produced and directed by Suga\u003cbr\u003e \u003ca href=\"https://youtu.be/fgyLhECCZlE\"\u003ehttps://youtu.be/fgyLhECCZlE\u003c/a\u003e\u003cbr\u003e\u003ca href=\"https://youtu.be/iUHMrVQrkHM\"\u003ehttps://youtu.be/iUHMrVQrkHM\u003c/a\u003e \u003cbr\u003eJin is a wonderful natural tenor and together with Jimin he have the highest vocal notes, that’s rare for males. Because of this he said it was hard for him to sing in ”Blue and Grey” written by V to fit his lower, darker voice. \u003cbr\u003eJk is a tenor and is considered to be the best singer in S.Korea. He sings effortlessly and has an incredible vocal range. JK showcases this in adlibs and many songs like in his bridge in ”ON”. V is a baritone with a characteristic, darker, charismatic voicebut as the others he can sing really high notes. \u003cbr\u003e\u003cbr\u003eBTS is natural, humble, open-minded and have spoken up about subjects as mental health, depression, self-love, gender-identity, youth issues, social society pressures, life, love, dreams etc. They’re well-spoken in their native Korean tongue. In English interviews the language barrier makes it difficult to express themselves with the words they’d like to. RM who’s the best in English is the group’s ”spokesperson”. However, the other members have improved their English through the years. Sometimes they in advance practice phrases that they want to say. \u003cbr\u003e\u003cbr\u003eWhen new International fans get to know BTS, they naturally learn more about the S.Korean culture. In general it’s more common for males to have physical contact, skinship, being touchy-feely and show softer emotional sides of themselves to the audience. That’s one reason why there’re alot of ”couple ships” with the members by their fans. But whatever relationship some members might have, real Army would always support them no matter what. There’re different couple constellations (both as couple and as friends) with all members. One loved trio is Jinjikook (Jin, Jimin, Jungkook). Jin the oldest has always been loved together with the maknae-line. It’s also more common for guys to care about skin routines. On their trips/vaccays we’ve seen members putting on their face cream and their selfies with face mask sheets on etc. \u003cbr\u003e\u003cbr\u003eAnother difference is how they dress up and appear on stage and have broken gender barrieres. They’ve shown a variety of styles (hair, make-up clothes, accessories) that have always matched the themes of their songs. Off stage privately the members have their individual great fashion style taste and taste. However all members have dyed their hair in all kinds of colors, wear jewellry, accessories, handbags etc. Since pre-debute 5 of 7 members have earpearcings and some have several tattoos, like JK and Jimin. \u003cbr\u003eAll members have their own customized glittery microphone in the colour they’ve chosen themselves, along with matching earpieces. (After collab with Halsey, BTS gifted her with her own glittery mic). To some non-Koreans all this can be seen as somewhat ”feminine”. Globally this is one of the beauties of BTS and makes them special as they’ve unintentionally broken stereotypes and challenged traditional masculinity. In 2021, BTS joined Louis Vuitton as Official House Ambassadors. LV house tweeted: ”the world renowned Pop Icons are recognised for their uplifting messages that impart a positive influence”, and in a press release: ”BTS is one of the most renowned and influential groups in the world”. \u003cbr\u003e\u003cbr\u003eBTS was the first artist of a project to create new cartoon characters for the Korean ”Line Friends”-series. (Line is a Korean texting app). Their presentation is called BT21 with 8 gender-neutral characters. All 7 members designed, named and came up with the background stories for their own characters. Their cute charachters who’ve similar personalities to themselves are: RM’s cozy koala ”Koya”, Jin’s sweet alpaca ”RJ”, Suga’s badass cooky ”Shooky”, J-hope’s masked dancing pony ”Mang”, Jimin’s adorable puppy ”Chimmy”, V’s heart-headed alien ”Tata”, Jungkook’s strong rabbit ”Cooky” (and Tata’s space robot ”Van” who is BT21&#39;s protector, to represent ARMY, created by RM). BT21 was officially launched in Oct 2017. There’re videos of BTS designing BT21 on BT21 YouTube channel. The members are ”fond of” their own characters. Jin has been seen buying his alpaca RJ stuffed animals, and seen carrying RJ when he travels, and he also had a mobile case and a pyjamas with RJ. Jin told us that when he eats he looks like an alpaca eating/chewing. An adorable video of Jin’s love for RJ: \u003ca href=\"https://youtu.be/sMZyzN_WP1E\"\u003ehttps://youtu.be/sMZyzN_WP1E\u003c/a\u003e  \u003cbr\u003eHere is BTS’s reaction to BT21 Universe Animation: \u003ca href=\"https://youtu.be/mjx7BLpJWbE\"\u003ehttps://youtu.be/mjx7BLpJWbE\u003c/a\u003e\u003cbr\u003eTheir charachters are sometimes present in ”Run BTS!”.\u003cbr\u003e\u003cbr\u003eThere’re also emojis that are being used to ”identify” the members on social medias, like twitter. Some are based on the Line characters and some are based on their personalities. It’s a little thing Army started doing when in reference to a member:\u003cbr\u003eJin 🐹 (hamster)\u003cbr\u003eSuga 🐱(cat)\u003cbr\u003eJ-Hope 🐿 (squirrel)\u003cbr\u003eRM 🐨 (koala)\u003cbr\u003eJimin 🐥 (baby chick)\u003cbr\u003eV 🐯 (tiger)\u003cbr\u003eJK 🐰 (bunny)\u003cbr\u003e\u003cbr\u003eBTS regularly interacts with Army through social media such as:\u003cbr\u003eThe members’ official twitter @BTS_twt (their label BigHit’s official twitter for BTS is @bts_bighit). \u003cbr\u003eTheir Youtube channel ”BANGTANTV” were they share video clips like ”BTS Bombs”, all their awesome dance practice videos, live-streams etc. BigHit shares videos on their official channel ”BigHit Labels”, were BTS’s MV’s are released. \u003cbr\u003eThe ”Weverse”-app were they release documentaries, concerts etc (get the app and follow BTS).\u003cbr\u003eThe ”VLive”-app were the members video stream live to Army who can comment in the chat (get the VLive-app, follow BTS and turn on notifications). In this app they have their popular, awesome long-runner VLive variety web-serie ”Run BTS!”, which premiered 2015 and airs once a week. In each episode the members have missions, challenges, competitions or do other activities in which they can earn prizes or punishments. By watching ”Run BTS!”, Army get to see more of the members’ great individual personalities, their cute, funny and playful sides and chemistry together. All seasons are available in the app. This is one ep.16 at the time of 2018 Winter Olympics in S.Korea: \u003ca href=\"https://youtu.be/mNmsxpC_HQ0\"\u003ehttps://youtu.be/mNmsxpC_HQ0\u003c/a\u003e\u003cbr\u003eA great Run ep. is BTS dubbing Disney movies Lion king, Toy story and Zootopia. All members were awesome and nailed their parts. Jimin in particular impressed fans with an incredible voice-over that suited Judy’s charachter perfectly. Zootopia’s co-director Jared Bush tweeted to @bts_bighit and @bts_twt:\u003cbr\u003e”I am super impressed with you.. Jimin your Judy reads are perfect.. When can we work together?!”\u003ca href=\"https://youtu.be/zBVsStPp9Hg\"\u003ehttps://youtu.be/zBVsStPp9Hg\u003c/a\u003e\u003cbr\u003eWhen a member has b-day he always goes VLive. The other members greet with a cake during the VLive or at some other moment which we get to see later in a ”BTS Bomb”. In the past Jin had his VLives ”Eat Jin”, and Jimin ”Jimin TV”.\u003cbr\u003e\u003cbr\u003eThere is also TikTok, Fancafe, Fb etc. \u003cbr\u003eMoreover BTS has their annual ”Summer Package” trip in early summer, along with photoshoots on location (2015: Kota Kinabalu, Malaysia. 2016: Dubai. 2017: Palawan, Philippines. 2018: Saipan, Northern Mariana Islands. 2019: Jeonju, S.Korea). JK created a wonderful video ”G.C.F Saipan”: \u003ca href=\"https://youtu.be/M1F1RxkXrDE\"\u003ehttps://youtu.be/M1F1RxkXrDE\u003c/a\u003e However, they’ve now replaced it with a ”Winter Package”, and the first was 2019: Helsinki, Finland. JK also created a beautiful ”G.C.F Helsinki”: \u003ca href=\"https://youtu.be/NgTwJQ2CUqI\"\u003ehttps://youtu.be/NgTwJQ2CUqI\u003c/a\u003e\u003cbr\u003eThey have their annual ”Bon Voyage” trip at the end of the summer, (BV 2016: Northern Europe, BV 2017: Hawaii. BV 2018: Malta. BV 2019: New Zealand). \u003cbr\u003e\u003cbr\u003eTo celebrate BTS’s anniversary June 13, 2013, they have their annual ”BTS Festa” which is like a month long event. For this celebration they have surprises for Army, special releases, photoshoots and more. They also shoot BTS’s anniversary ”Family portrait”. As a part of the 2017 Festa, Jimin and Jungkook released a beautiful cover of ”We Don’t Talk Anymore”: \u003ca href=\"https://youtu.be/RbctNBlXBJc\"\u003ehttps://youtu.be/RbctNBlXBJc\u003c/a\u003e \u003cbr\u003eDuring this time they also hold their annual ”Fan Gathering Event” aka ”Muster” concert. It’s usually a two-days concert which always has a specific theme with special performances of only certain songs, fun games, video sketches etc.\u003cbr\u003e\u003cbr\u003eContinue part 6 of 7 in the replies",
