 games, snowboarding, fishing and goes mostly with Suga since both have few friends they hang out with. Jin is quite shy and has mentioned he’s got no friends, besides his 7 dongsaengs = younger brothers of BTS who’re his family. Jin said: ”We’re together like 360 out of 365 days”. \nJust as J-Hope he is known for being a ”scaredy-cat”, gets scared easily. The members have been together almost 24/7 for 10 years and are like an ”old married couple”.\n\nV is born in Daegu and has a younger sister and younger brother. He lived with his grandmother for many years who passed away which he cryingly revealed on stage some years ago. He was 15 when he joined BigHit and also got to be the visual. He got known for his dorky side and goofy sense of humour. Fans has also said that he looked like a pretty anime characther. He is great in basketboll and learns new choreo quickly. He has a dog named Yeontan ”Tannie” who is well-known among Army and has appeared in tweets and BTS Bombs. In 2016 V starred in the Korean TV-drama ”Hwarang: The Poet Warrior Youth”. \n\nJ-Hope is born in Gwangju has an older sister Jiwoo. He is called ”the sunshine” of the group because of his sparky, energetic and enthusiastic nature, and has close to his loud, cheerful laughter. He can both rap and sing, and although RM and Suga are awesome in both ”classic” and ”melodic” rap, and can sing too, J-Hope is the best singer of the rapline. He was a dancer before BTS and is one of the group’s best dancers. He is their dance leader and in main charge of the choreography for BTS. They also got choreographer Son Sungdeuk who’ve been with them for a long time. J-Hope has a dog Mickey. \n \nJimin is born in Busan (just as JK) and has a younger brother Jihyun. The members have said that Jimin has a special aura about him, and is the cutest, most charming in the team: https://youtu.be/QHtRqopj3JI  He has a friendly, likable personality and is very funny: https://youtu.be/7nvkf6lRtZg \nHe is known for his androgynous attractive looks, and for being ”lovely, sexy and cute”. There’s a saying: ”Once u JimIN, u can’t JimOUT”. Some nicknames are ”Chimchim”, ”Minnie”, ”Mochi”, ”Mangetteok”(sticky ricecake), the last two he got in the beginning because he had his cute, milky, round, babyfat cheeks/face.\nIn school Jimin was excellent in both sports and academics, and was the ”Class President”. Above all, Jimin was legendary, an absolute top student at ”Busan Highschool of Arts” and was majoring in the modern/contemporary Dance department. He was (and still is) exceptional and entered at the top of his class, including all students of both genders and in all majors (Dance, Music, Arts). Normally students majoring in Music or Arts enter at the top, so it’s very rare for a Dance-majoring student to enter at the top. Jimin could’ve had a successful International career. At one of his teacher’s wedding, he got to do a solo dance performance. During middle school he attended a Dance Academy and learned popping and locking dance, and was winning street-dance battles in Busan. A young pre-debute Jimin: https://youtu.be/wPywFydPOS0  \nHis WIDE RANGE and brilliance in different genres (not only one), from hiphop to contemporary and classical ballet etc is astounding. He is one of the best dancers in the world, and definitely the best artist/idol dancer we’ve ever seen. Jimin is known for his perfect lines, impressive flexibility, prominent moves and extraordinary fluidity and smoothness. He is also known for his fascinating duality on and off stage.\n\nJimin has also studied different kinds of martial arts like Kendo, and had a black belt in Taekwondo. K-media wrote; ”Basketball, jump rope.. What can’t he do? Besides being an entertainment god with a natural sense of entertainment, he’s also outstanding athleticism”.\n\nJimin 21, is opening ”SBS Gayo Daejun 2016” with other pro-dancers and K-artists:\nhttps://youtu.be/bXN_TZyycYk\nhttps://youtu.be/vdOQsDO1gjA\nAs a dancer myself, I don’t think general people understand the strength and control Jimin has, and sadly never will. His flawless lines, his posture, how he keeps his toes pointed in his jumps, the airtime and still manage to lands lightly which takes years of hard training to ever attain. He is on a whole other level than any idol I’ve ever seen, even compared to these other dancers. He is very well-known among Korean modern dancers, who all agree he has raised the bar for idol dancers.\n\nJimin’s 24, breathtaking solo dance performance to a piano version of BTS’s song ”I need u”, at ”MMA” 2019: https://youtu.be/8D7Wnnow2kQ \n \nJ-Hope 24, Jimin 23, and Jungkook 21 (called the 3J’s and the best dancers), amazing performances to traditional Korean tunes and instruments, dressed in Korean attires at ”MMA” 2018: https://youtu.be/XozYg4IuDgY\nAfterwards Jimin recieved plaque of appreciation from the ”Cultural Conservation Society”. \n\nAt ”MAMA” 2016, Jimin 21 (impressively dancing blindfolded which is extremely difficult) and J-hope 22, performing perfectly in-sync: https://youtu.be/PYRiohUv-9Y\n\nJimin 24, Behind-the-scenes of his contemporary solo parts in Black Swan MV (2:40) : https://youtu.be/xMfp2jcK52M\n\nAt BTS’s online concert ”Map of the Soul ON:E” 2020, Jimin performed two solos. His incredible ”Black Swan” contemporary dance solo: \nPt.2 https://youtu.be/RM_OYxn0cTg\nPt.3 https://youtu.be/FL8sD9UHdZs\nPt.4 https://youtu.be/alm9jzWlmkI\nHis stunning performance of ”Filter”: https://youtu.be/FcVYa077Rgg\n\nNo band today, and no past Western boyband were ever close to any of this, nor be able to pull off World Stadium tours. Smaller concerts yesbut not close to arenas with 70000+ audience. Stadiums like MetLife, Rose Bowl, Soldier Field, Wembley, Stade de France etc. All members are individually very talented. They equally sing or rap with distinct voices which are easy to recognize, and together blend and harmonize perfectly. Unlike past Western boybands were litterally 2 or 3 out of 5 could sing. The rest were anonymous, had no solo parts and barely ever heard. BTS has set the bar high for future boybands. They’re pioneers, innovaters and was the first K-act and Asian-act to really make it in America and globally. Their hard work has undoubtly paved the way for other K-artists.\n\nThe premiere performance of ”Black Swan” from 2020 album ”Map Of The Soul: 7” at the ”Late late show with James Gordon”, proved once again they aren’t the prejudice of ”just a boyband”. They’re artistic performers with remarkable diversity, versatility, artistery, dance skills, vocals, rap: https://youtu.be/wSNd02kVv8o\nTheir instrumental violin ”Black Swan” performance at MMA 2020 was mind-blowing art: https://youtu.be/0bgL7juKY6Q\nFrom the same album there’s title track ”ON” with downright insane choreo, with a spectacular MV: https://youtu.be/gwMa6gpoE9I. The ”ON” MV no.2 is like a grand, epic movie: https://youtu.be/mPVDGOVjRQ0\nOne of their amazing live ”ON” performances: https://youtu.be/4LE5dSA6RFg\nThey also performed ”ON” at the Grand Central Terminal, NYC, at the ”Tonight show with Jimmy Fallon”.\n\nAntis who’re used to Western artists who don’t do hard dance choreo, have accused BTS for lip-syncing. Pre-debute they practiced 24/7 to become skilled at both at the same time, and still do for comebacks and performances. Take a look at BTS’s ”MAMA nominees performance” 2019 of powerful ”Dionysius”, which shows their live skills of both dancing and singing/rap: https://youtu.be/BxcUVsa2gb0\nIn the Western music scene it’s very common to use backtracks, even artists without any choreo at all. BTS rarely complements their live vocals with a backtrack, only sometimes in very tough choreo parts. The insane choreo in ”ON” dance practice video: https://youtu.be/VkuEzN8IS_o\n\nContinue part 5 of 7 in the replies",
