              "textDisplay": "Part 3 of 7: \u003cbr\u003e\u003cbr\u003eIn Sep 2018 they were the first Western and Korean boyband to be invited to the U.N. United Nations, for the launch ceremony of UNICEF&#39;s global partnership Generation Unlimited. BTS delivered a speech in which they urged young people to believe in their own convictions and voices, to not only Love Yourself but also to Speak Yourself. RM ended his speech with the words: ”No matter who you are, no matter where you’re from, your skin color, your gender identity..speak yourself, find your name and find your voice, by speaking yourself”. \u003cbr\u003e\u003cbr\u003eFor the Korean music award season at the end of every year, BTS practices so hard for their performances. Award shows such as: Golden Disk Awards (GDA), Gaon Chart Music Awards, Seoul Music Awards (SMA), Korean Music Awards (KMA), Fact Music Awards, Asia Artist Awards (AAA), Mnet Asian Music Awards (MAMA), Melon Music Awards (MMA), Plus x Genie Music Awards (MGA), SBS Gayo Daejeon, KBS Gayo Daechukje. BTS has won the most ”Daesangs” (biggest prestigious main music awards) in S.Korean history as of now with over 40 daesangs. They’re also the overall most decorated K-artist in history. \u003cbr\u003eAt ”MAMA” 2019, BTS performed their first singles ”We Are Bulletproof Pt.2” and ”N.O” from 2013 debute album: \u003ca href=\"https://youtu.be/gdrO-iU3Glg\"\u003ehttps://youtu.be/gdrO-iU3Glg\u003c/a\u003e\u003cbr\u003eA must-watch is the dance practice for their 2020 MAMA performance of ”ON”: \u003ca href=\"https://youtu.be/81sNq45I48s\"\u003ehttps://youtu.be/81sNq45I48s\u003c/a\u003e  Suga wasn’t able to perform that season due to a shoulder surgery.\u003cbr\u003e\u003cbr\u003eBTS was ignored at the Grammys 2020, despite the fact that they (with ”Map of the Soul: Persona”) had the 3rd bestselling album worldwide 2019, and litterally out-sold all the other artists that were nominated for ”Album of the year”. Some said BTS isn’t American and doesn’t sing in Englishbut it shouldn’t matter at all if looking back through the years with all non-Americans. Besides, it doesn’t need to be in English either. Puerto Rican Luis Fonci’s (born 1978) all Spanish ”Despacito” was totally embraced by the Grammys. \u003cbr\u003eFor the Grammys 2021, BTS finally got a nomination in the category ”Best Pop Duo/Group Performance”. Although they boys are ecstatic and honoured, alot of people agree they deserved nominations in other categories too. They had the bestselling album 2020, not only in S.Korea, Japan and USA but also Worldwide with masterpiece ”Map of The Soul: 7”, and really deserved a nomination in the ”Album of the year” category. Korean BTS has quality and artistery on all levels, which is something that alot of people in the American/European/Western music industry refuse to accept or admit. \u003cbr\u003eTheir spectacular ”Dynamite” performance: \u003ca href=\"https://youtu.be/IU9KRreWIH8\"\u003ehttps://youtu.be/IU9KRreWIH8\u003c/a\u003e\u003cbr\u003eHowever, BTS is the first Korean-act in history to get a nomination, and also the first Korean act to perform at the Grammys in 2020, even though BTS was only ”back-up” for Lil Nas X.\u003cbr\u003e\u003cbr\u003e“Please don’t forget that whether we get the Grammy or not, we already got what we wanted and we got YOU, so that means we got everything.” \u003cbr\u003e- Kim Namjoon (RM)\u003cbr\u003e\u003cbr\u003eIn their early years, BTS went through alot of sacrifices, hardships and struggles, both as a group and individually. Their tears and break-downs on stage (of gratitude, love, relief after hard work etc) during their speeches at award-shows and at concerts are heartbreaking. They’ve always loved, cared for, encouraged and inspired Army, and many have expressed how BTS and their music have lighten up and changed their lives. Army who’ve had a hard time have gained positivity, strength, confidence, well-being, inspiration and belief for the future etc.\u003cbr\u003e\u003cbr\u003eIt’s unfair and sad that alot of Western showbiz and media plainly ignore and reduce BTS, and that many radio channels won’t play their music. Those people don’t know anything about BTS and aren’t interested in finding out either. But still they’re discriminating, downgrading, not taking them seriously and don’t give them recognition only because they’re a Korean/East Asian group. They should step back with their narrow minds and predjudice. How can their race matter that much?\u003cbr\u003eRM said: ”We’re just normal guys who love to make music and to perform, and want to share it with our fans”. \u003cbr\u003eBesides, BTS isn’t just ”any” Kpop group. They’re totally outstanding and has an unique charm we haven’t seen before. Their music and achievements are groundbreaking, not only in Kpop but in the global scene. Their consistency, passion, dedication, hard work, artistery and talent are undeniable. What makes other Western artists’ generic mainstream music more real and genuine whose music are being played over and over?! Besides, Western media is unreasonably never ranking BTS in the top of ”the biggest boybands in history-lists”. \u003cbr\u003e\u003cbr\u003eKpop has a huge domestic market and has for a long time been considered a generic name for all Korean music genres, not only pop. No one needs to hit globally to become stars. BTS has never needed to collab. with a Western artist or make an English album to become superstars, or get where they are today. They’ve made it on their own singing in Korean. They’ve collab. simply because they’ve liked the artist. The truth is, other artists would gain more of a collab. with BTS than the other way around because of BTS’s huge fanbase. Yet in interviews they’re repeatedly asked which Western artist they want to collab. with, as if it’d be the highest wish of their career. They’re also pressured when always asked about their next goal, instead of letting them breath after hard work and enjoy the moment. \u003cbr\u003e\u003cbr\u003eBTS is mainly producing, composing and writing their own songs and lyrics, sometimes co-writing too. They’re dedicated and sincere with alot of thoughts and reflections behind their music. It’s not just empty words written by others who don’t know them. The members’ solo songs are written by the member himself or together with a member. They’ve also released non-profitable solo songs (and not on an official album), like Jimin’s ”Promise” and V’s ”Winter Bear” on SoundCloud. JK has multiple times released incredible English and Korean ballad covers. Some releases have also been surprises for Army at the ”BTS Festa” through the years. JK and Jimin made a beautiful cover of ”We Don’t Talk Anymore” for the 2017 ”BTS Festa”.\u003cbr\u003eBTS’s work is inspired by litterature, art and philosophy. Their lyricism is well-written, poetical and really on another level. All their MV’s have English subs that International Army are suppose to turn on, although the English translations can’t do fully justice.\u003cbr\u003e\u003cbr\u003eBTS has a solid discography in both Korean and Japanese with roots in hiphop and R&amp;B. In their early years all 7 studied Japanese and all members can speak Japanese, especially JK and the maknae line as they were younger when they started. When they perform in Japan they sing many of their songs in Japanese. There’re also songs made only in Japanese, like awesome ”Don’t Leave Me”: \u003ca href=\"https://youtu.be/Cz6BUM4F2tY\"\u003ehttps://youtu.be/Cz6BUM4F2tY\u003c/a\u003e and ”Stay Gold”: \u003ca href=\"https://youtu.be/9C1BNeLmhLk\"\u003ehttps://youtu.be/9C1BNeLmhLk\u003c/a\u003e  All BTS’s albums are highly complex concept albums, always with a well thought-out theme and storyline. The songs and MV’s for the songs on the same album, have intertwined connections, messages and symbolism. They also connect with their previous work, and if u put all the albums together in order they tell a ”story”. Usually Army discover the connections little by little, sometimes making theories too.\u003cbr\u003e\u003cbr\u003eRM 26 is born in Ilsan and has a younger sister. He was in the underground scene for a long time before BTS, and has over 150 songs under his name, all masterpieces. He is a prodigy but underrated. He has an IQ of over 148 and scored among the highest within the top 1% of the nation in the massive University Entrance Exams. He also scored over 900 on the ”Test of English for International Communication” while he was still in Middle school. He is awesome in English which he learned as a youngster by watching TV-show ”Friends”. He’s known for his ”cultural” side and is collecting arts, enjoys museums, parks, sightseeing, bicycling. He’s also known for being clumsy, accidentally spilling, breaking or hitting things as well as losing his stuff (passport, earpods, mobile), and is by the members called ”God of destruction”. He’s been quite bad at cooking, although he and the others have improved through the years. Suga and Jin are the best chefs.\u003cbr\u003e\u003cbr\u003eSuga is born in Daegu and has an older brother. He got early known as the ”savage” of the group. He is deep, wise, honest, doesn’t open-up or show feelings easily and isn’t as touchy-feely. He usually dosen’t show as much facial expressions or make eye contact, which are something that the other members have had alot of fun about. He’s is known for his gummy smile. The members and Army sometimes make jokes about him for being tired, wanting to rest or sleep, not moving if not necessary. Jin once joked to the cam: ”Now I’ll go into Suga’s mind and he wishes to be born as a stone in his next life”. Suga can rap impressively fast and is the fastest of the 3 rappers. He is an incredible producer who’s also collaborated and produced songs for other Korean artists, and has won ”Best Producer” awards. He and RM are the members who’re writing most of BTS’s songs. Moreover he has a dog named Holly. In the past Suga was a great basketboll player. He is also playing guitar and is an amazing piano player. Here he’s beautifully playing a part of his piano version of BTS’s ”I need u”: \u003ca href=\"https://youtu.be/JyHaRCMbx6A\"\u003ehttps://youtu.be/JyHaRCMbx6A\u003c/a\u003e \u003cbr\u003eThis is a low-key performance of ”I need u” at ”Picnic Live MBC” on a rooftop 2015: \u003ca href=\"https://youtu.be/S8gT8KhkGBQ\"\u003ehttps://youtu.be/S8gT8KhkGBQ\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eContinue part 4 of 7 in the replies.",
