lly embraced by the Grammys. \nFor the Grammys 2021, BTS finally got a nomination in the category ”Best Pop Duo/Group Performance”. Although they boys are ecstatic and honoured, alot of people agree they deserved nominations in other categories too. They had the bestselling album 2020, not only in S.Korea, Japan and USA but also Worldwide with masterpiece ”Map of The Soul: 7”, and really deserved a nomination in the ”Album of the year” category. Korean BTS has quality and artistery on all levels, which is something that alot of people in the American/European/Western music industry refuse to accept or admit. \nTheir spectacular ”Dynamite” performance: https://youtu.be/IU9KRreWIH8\nHowever, BTS is the first Korean-act in history to get a nomination, and also the first Korean act to perform at the Grammys in 2020, even though BTS was only ”back-up” for Lil Nas X.\n\n“Please don’t forget that whether we get the Grammy or not, we already got what we wanted and we got YOU, so that means we got everything.” \n- Kim Namjoon (RM)\n\nIn their early years, BTS went through alot of sacrifices, hardships and struggles, both as a group and individually. Their tears and break-downs on stage (of gratitude, love, relief after hard work etc) during their speeches at award-shows and at concerts are heartbreaking. They’ve always loved, cared for, encouraged and inspired Army, and many have expressed how BTS and their music have lighten up and changed their lives. Army who’ve had a hard time have gained positivity, strength, confidence, well-being, inspiration and belief for the future etc.\n\nIt’s unfair and sad that alot of Western showbiz and media plainly ignore and reduce BTS, and that many radio channels won’t play their music. Those people don’t know anything about BTS and aren’t interested in finding out either. But still they’re discriminating, downgrading, not taking them seriously and don’t give them recognition only because they’re a Korean/East Asian group. They should step back with their narrow minds and predjudice. How can their race matter that much?\nRM said: ”We’re just normal guys who love to make music and to perform, and want to share it with our fans”. \nBesides, BTS isn’t just ”any” Kpop group. They’re totally outstanding and has an unique charm we haven’t seen before. Their music and achievements are groundbreaking, not only in Kpop but in the global scene. Their consistency, passion, dedication, hard work, artistery and talent are undeniable. What makes other Western artists’ generic mainstream music more real and genuine whose music are being played over and over?! Besides, Western media is unreasonably never ranking BTS in the top of ”the biggest boybands in history-lists”. \n\nKpop has a huge domestic market and has for a long time been considered a generic name for all Korean music genres, not only pop. No one needs to hit globally to become stars. BTS has never needed to collab. with a Western artist or make an English album to become superstars, or get where they are today. They’ve made it on their own singing in Korean. They’ve collab. simply because they’ve liked the artist. The truth is, other artists would gain more of a collab. with BTS than the other way around because of BTS’s huge fanbase. Yet in interviews they’re repeatedly asked which Western artist they want to collab. with, as if it’d be the highest wish of their career. They’re also pressured when always asked about their next goal, instead of letting them breath after hard work and enjoy the moment. \n\nBTS is mainly producing, composing and writing their own songs and lyrics, sometimes co-writing too. They’re dedicated and sincere with alot of thoughts and reflections behind their music. It’s not just empty words written by others who don’t know them. The members’ solo songs are written by the member himself or together with a member. They’ve also released non-profitable solo songs (and not on an official album), like Jimin’s ”Promise” and V’s ”Wint