ng arts, enjoys museums, parks, sightseeing, bicycling. He’s also known for being clumsy, accidentally spilling, breaking or hitting things as well as losing his stuff (passport, earpods, mobile), and is by the members called ”God of destruction”. He’s been quite bad at cooking, although he and the others have improved through the years. Suga and Jin are the best chefs.\n\nSuga is born in Daegu and has an older brother. He got early known as the ”savage” of the group. He is deep, wise, honest, doesn’t open-up or show feelings easily and isn’t as touchy-feely. He usually dosen’t show as much facial expressions or make eye contact, which are something that the other members have had alot of fun about. He’s is known for his gummy smile. The members and Army sometimes make jokes about him for being tired, wanting to rest or sleep, not moving if not necessary. Jin once joked to the cam: ”Now I’ll go into Suga’s mind and he wishes to be born as a stone in his next life”. Suga can rap impressively fast and is the fastest of the 3 rappers. He is an incredible producer who’s also collaborated and produced songs for other Korean artists, and has won ”Best Producer” awards. He and RM are the members who’re writing most of BTS’s songs. Moreover he has a dog named Holly. In the past Suga was a great basketboll player. He is also playing guitar and is an amazing piano player. Here he’s beautifully playing a part of his piano version of BTS’s ”I need u”: https://youtu.be/JyHaRCMbx6A \nThis is a low-key performance of ”I need u” at ”Picnic Live MBC” on a rooftop 2015: https://youtu.be/S8gT8KhkGBQ\n\nContinue part 4 of 7 in the replies.",
